import React from 'react'
import Star from './Star'
import stars from '../libs/star'

const Article = (props) => {
    const { article } = props;
    return(
        <div class="post-preview">
          <a href="post.html">
            <h2 class="post-title">
              {article.title}
            </h2>
            <b class="post-content">
              {article.content}
            </b>
          </a>
          <p class="post-meta">Posted by <a href="#">{article.author.n_name}</a> on {article.date}</p>
            <span class="text-warning">
                <Star rating={article.rating} />
            </span>
        </div>
    )
}

export default Article;
